import React from "react";
import "./card.css"
import pokemonTypes from "./pokemonTypes"


const Card = ({pokemon})=>{
    // let img = props.pokemon.sprites.front_default
    return (
        <div className="Card">
            <div className="Card-img">
                <img src= {pokemon.sprites.front_defaut}/>

            </div>

            <div className="Card-name">
                {pokemon.name}
            </div>

            <div className="Card-types">
                {pokemon.types.map(type =>{
                    return(
                        <div className="Card-type" style={{backgroundColor:pokemonTypes[type.type.name]}}>
                            {type.type.name}
                        </div>
                    )
                })}

            </div>

            <div className="Card-info">
                <div>"ni hao"</div>
                <div className="Card-data Card-data-weight">
                    <p className="title">weight</p>
                    {console.log("hi")}
                    {console.log(pokemon.weight)}
                    <p>{pokemon.weight}</p>
                </div>
                <div className="Card-data Card-data-height">
                    <p className="title">height</p>
                    <p>{pokemon.height}</p>
                </div>
                <div className="Card-data Card-data-ability">
                    <p className="title">ability</p>
                    <p>{pokemon.abilities[0].ability.name}</p>
                </div>

            </div>
        </div>

    )

}

export default Card;
